
# Tabloları oluştururken kullanılacak SQL kodları

#tabloları oluştururken SIGORTA tablosuna kadarexecute edilmeli ardından REZERVASYONLAR  sonrasında KIRALAMA tablosu oluşturulmalıdır. sonrasında diğer tablolar oluşturulabilir.
CREATE TABLE SUBELER (
    SUBE_ID INT PRIMARY KEY IDENTITY(1,1),
    SUBE_ADI VARCHAR(100) NOT NULL,
    ADRES VARCHAR(500) NOT NULL,
    TELEFON VARCHAR(15),
    IL VARCHAR(50) NOT NULL,
    ILCE VARCHAR(50) NOT NULL
);


CREATE TABLE MODEL (
    MODEL_ID INT PRIMARY KEY IDENTITY(1,1),
    Marka VARCHAR(100) NOT NULL,
    Seri VARCHAR(100),
    Model VARCHAR(150) NOT NULL,
    Yil SMALLINT NOT NULL,
    Yakit_Tipi VARCHAR(50),
    Vites VARCHAR(50),
    Sanziman VARCHAR(50),
    Kasa_Tipi VARCHAR(50),
    Kapi_Sayisi TINYINT,
    Koltuk_Sayisi TINYINT,
    Yakit_Tuketimi_SI DECIMAL(4, 1),
    Yakit_Tuketimi_SD DECIMAL(4, 1),
    Yakit_Depo_Hacmi SMALLINT,
    Motor_Gucu SMALLINT,
    Motor_Hacmi SMALLINT,
    Segment VARCHAR(10),
    Azami_Surat SMALLINT,
    Uzunluk SMALLINT,
    Genislik SMALLINT,
    Yukseklik SMALLINT,
    Agirlik SMALLINT,
    Bagaj_Hacmi SMALLINT,
    GUNLUK_KIRA_BEDELI DECIMAL(10, 2) NOT NULL,
    DEPOZITO_UCRETI DECIMAL(10, 2) NOT NULL
);


CREATE TABLE EK_HIZMETLER (
    HIZMET_ID INT PRIMARY KEY IDENTITY(1,1),
    HIZMET_ADI VARCHAR(150) NOT NULL,
    UCRET_TIPI VARCHAR(20) NOT NULL, 
    UCRET DECIMAL(10, 2) NOT NULL
);


CREATE TABLE KAMPANYALAR (
    KAMPANYA_ID INT PRIMARY KEY IDENTITY(1,1),
    KAMPANYA_ADI VARCHAR(255) NOT NULL,
    BASLANGIC_TARIHI DATE,
    BITIS_TARIHI DATE,
    INDIRIM_ORANI DECIMAL(5, 2),
    KOSULLAR VARCHAR(1000),
    AKTIF_MI BIT DEFAULT 1
); 


CREATE TABLE ARAC (
    SASE_NO VARCHAR(17) PRIMARY KEY,
    MODEL_ID INT NOT NULL FOREIGN KEY REFERENCES MODEL(MODEL_ID),
    GUNCEL_SUBE_ID INT NOT NULL FOREIGN KEY REFERENCES SUBELER(SUBE_ID),
    PLAKA VARCHAR(15) NOT NULL UNIQUE,
    KM INT NOT NULL,
    DURUM VARCHAR(50) NOT NULL,
    RENK VARCHAR(50)
);


CREATE TABLE CALISANLAR (
    CALISAN_ID INT PRIMARY KEY IDENTITY(1,1),
    SUBE_ID INT NOT NULL FOREIGN KEY REFERENCES SUBELER(SUBE_ID),
    TC_NO VARCHAR(11) NOT NULL UNIQUE,
    [E-MAIL] VARCHAR(255) NOT NULL UNIQUE, 
    AD VARCHAR(100) NOT NULL,
    SOYAD VARCHAR(100) NOT NULL,
    TELEFON VARCHAR(15),
    DOGUM_TARIHI DATE,
    ADRES VARCHAR(500),
    ISE_GIRIS_TARIHI DATE,
    POZISYON VARCHAR(100),
    MAAS DECIMAL(10, 2),
    DURUM VARCHAR(50) DEFAULT 'Aktif'
);


CREATE TABLE MUSTERILER (
    MUSTERI_ID INT PRIMARY KEY IDENTITY(1,1),
    TC_NO VARCHAR(11) NOT NULL UNIQUE,
    EHLIYET_ID VARCHAR(20) NOT NULL UNIQUE,
    AD VARCHAR(100) NOT NULL,
    SOYAD VARCHAR(100) NOT NULL,
    TELEFON VARCHAR(15) NOT NULL,
    [E-MAIL] VARCHAR(255) NOT NULL UNIQUE,
    DOGUM_TARIHI DATE,
    ADRES VARCHAR(500),
    EHLIYET_VERILIS_TARIHI DATE,
    EHLIYET_SINIFI VARCHAR(10),
    KAYIT_TARIHI DATETIME DEFAULT GETDATE(),
    DURUM VARCHAR(50) DEFAULT 'Aktif'
);


CREATE TABLE SIGORTA (
    SIGORTA_ID INT PRIMARY KEY IDENTITY(1,1),
    SASE_NO VARCHAR(17) NOT NULL FOREIGN KEY REFERENCES ARAC(SASE_NO),
    SIGORTA_ADI VARCHAR(100),
    KAPSAM_TURU VARCHAR(100),
    KAPSAM_ACIKLAMASI VARCHAR(1000),
    MALIYET DECIMAL(10, 2),
    BASLANGIC_TARIHI DATE,
    BITIS_TARIHI DATE,
    AKTIFMI BIT,
    OLUSTURULMA_TARIHI DATETIME DEFAULT GETDATE(),
    GUNCELLEME_TARIHI DATETIME
);


CREATE TABLE BAKIM_KAYITLARI (
    BAKIM_ID INT PRIMARY KEY IDENTITY(1,1),
    SASE_NO VARCHAR(17) NOT NULL FOREIGN KEY REFERENCES ARAC(SASE_NO),
    CALISAN_ID INT NULL FOREIGN KEY REFERENCES CALISANLAR(CALISAN_ID),
    BAKIM_TARIHI DATE NOT NULL,
    BAKIM_TURU VARCHAR(100),
    BAKIM_UCRETI DECIMAL(10, 2),
    PARCA_DEGISTIMI BIT,
    DEGISEN_PARCA VARCHAR(255)
);


CREATE TABLE KAZA_KAYITLARI (
    KAZA_ID INT PRIMARY KEY IDENTITY(1,1),
    
    KIRALAMA_ID INT NOT NULL FOREIGN KEY REFERENCES KIRALAMA(KIRALAMA_ID),
    KAZA_TARIHI DATE NOT NULL,
    HASAR_TURU VARCHAR(255),
    HASAR_MIKTARI DECIMAL(10, 2),
    SIGORTA_DURUMU VARCHAR(100)
);


CREATE TABLE KULLANICI_HESAPLARI (
    HESAP_ID INT PRIMARY KEY IDENTITY(1,1),
    MUSTERI_ID INT NOT NULL UNIQUE 
        FOREIGN KEY REFERENCES MUSTERILER(MUSTERI_ID) 
        ON DELETE CASCADE,
    
    SIFRE_HASH VARCHAR(500) NOT NULL,
    HESAP_DURUMU VARCHAR(50) DEFAULT 'Onay Bekliyor',
    SON_GIRIS_TARIHI DATETIME
);


CREATE TABLE REZERVASYONLAR (
    REZERVASYON_ID INT PRIMARY KEY IDENTITY(1,1),
    MUSTERI_ID INT NOT NULL FOREIGN KEY REFERENCES MUSTERILER(MUSTERI_ID),
    MODEL_ID INT NOT NULL FOREIGN KEY REFERENCES MODEL(MODEL_ID),
    PLANLANAN_ALIS_SUBE_ID INT NOT NULL FOREIGN KEY REFERENCES SUBELER(SUBE_ID),
    PLANLANAN_TESLIM_SUBE_ID INT NOT NULL FOREIGN KEY REFERENCES SUBELER(SUBE_ID),
    PLANLANAN_ALIS_TARIHI DATETIME NOT NULL,
    PLANLANAN_TESLIM_TARIHI DATETIME NOT NULL,
    KAMPANYA_ID INT NULL FOREIGN KEY REFERENCES KAMPANYALAR(KAMPANYA_ID),
    REZERVASYON_TARIHI DATETIME DEFAULT GETDATE(),
    REZERVASYON_DURUMU VARCHAR(50) DEFAULT 'Onay Bekliyor'
);


CREATE TABLE KIRALAMA (
    KIRALAMA_ID INT PRIMARY KEY IDENTITY(1,1),
    MUSTERI_ID INT NOT NULL FOREIGN KEY REFERENCES MUSTERILER(MUSTERI_ID),
    SASE_NO VARCHAR(17) NOT NULL FOREIGN KEY REFERENCES ARAC(SASE_NO),
    ALIS_CALISAN_ID INT NOT NULL FOREIGN KEY REFERENCES CALISANLAR(CALISAN_ID),
    TESLIM_CALISAN_ID INT NULL FOREIGN KEY REFERENCES CALISANLAR(CALISAN_ID),
    ALIS_SUBE_ID INT NOT NULL FOREIGN KEY REFERENCES SUBELER(SUBE_ID),
    GERCEKLESEN_TESLIM_SUBE_ID INT NULL FOREIGN KEY REFERENCES SUBELER(SUBE_ID),
    REZERVASYON_ID INT NULL FOREIGN KEY REFERENCES REZERVASYONLAR(REZERVASYON_ID),
    
    
    ALIS_TARIHI DATETIME NOT NULL,
    PLANLANAN_TESLIM_TARIHI DATETIME NOT NULL,
    GERCEKLESEN_TESLIM_TARIHI DATETIME NULL,
    
    ALIS_KM INT NOT NULL,
    DONUS_KM INT NULL,
    
    KIRA_GUNLUK_BEDEL DECIMAL(10, 2) NOT NULL,
    ALINAN_DEPOZITO DECIMAL(10, 2) NOT NULL,
    DEPOZITO_DURUMU VARCHAR(50) DEFAULT 'Alındı',
    TOPLAM_KIRA_TUTARI DECIMAL(10, 2) NULL
);


CREATE TABLE CEZA (
    CEZA_ID INT PRIMARY KEY IDENTITY(1,1),
    KIRALAMA_ID INT NOT NULL FOREIGN KEY REFERENCES KIRALAMA(KIRALAMA_ID),
    CEZA_TARIHI DATE NOT NULL,
    CEZA_TURU VARCHAR(255) NOT NULL,
    CEZA_TUTAR DECIMAL(10, 2) NOT NULL
);


CREATE TABLE ODEMELER (
    ODEME_ID INT PRIMARY KEY IDENTITY(1,1),
    KIRALAMA_ID INT NULL FOREIGN KEY REFERENCES KIRALAMA(KIRALAMA_ID),
    
    CEZA_ID INT NULL FOREIGN KEY REFERENCES CEZA(CEZA_ID),
    
    ODEME_TARIHI DATETIME DEFAULT GETDATE(),
    ODEME_TUTARI DECIMAL(10, 2) NOT NULL,
    ODEME_TURU VARCHAR(50),
    ODEME_TIPI VARCHAR(50) NOT NULL
);


CREATE TABLE KIRALAMA_HIZMETLERI (
    KIRALAMA_ID INT NOT NULL,
    HIZMET_ID INT NOT NULL,
    ADET INT DEFAULT 1,
    ALINAN_UCRET DECIMAL(10, 2),
    
    PRIMARY KEY (KIRALAMA_ID, HIZMET_ID),
    FOREIGN KEY (KIRALAMA_ID) REFERENCES KIRALAMA(KIRALAMA_ID),
    FOREIGN KEY (HIZMET_ID) REFERENCES EK_HIZMETLER(HIZMET_ID)
);


